你可以在类型系统中编码一个状态机。 每个状态都有不同的类型。 每个状态类型都实现了不同的方法。 一些方法会消耗这个状态类型（获取所有权）并且返回另一个状态类型。 这个技巧在 Rust 中工作地非常良好，因为你的方法可以将数据移动到新的类型中，并且保证在之后你就无法访问旧状态了。 这是一个关于邮寄包裹的小例子： let p: OpenPackage = Package::new();
