Associated types are frequently referred to in the signatures of a trait's methods and associated functions, and it is natural and convenient to refer to them directly. In other words, writing this: trait Graph { type N; type E; fn has_edge(&self, &N, &N) -> bool; ...
} is more appealing than writing this: trait Graph { type N; type E; fn has_edge(&self, &Self::N, &Self::N) -> bool; ...
} This RFC proposes to treat both trait and impl bodies (both inherent and for traits) the same way we treat mod bodies: all items being defined are in scope. In particular, methods are in scope as UFCS-style functions: trait Foo { type AssocType; lifetime 'assoc_lifetime; const ASSOC_CONST: uint; fn assoc_fn() -> Self; // Note: 'assoc_lifetime and AssocType in scope: fn method(&self, Self) -> &'assoc_lifetime AssocType; fn default_method(&self) -> uint { // method in scope UFCS-style, assoc_fn in scope let _ = method(self, assoc_fn()); ASSOC_CONST // in scope }
} // Same scoping rules for impls, including inherent impls:
struct Bar;
impl Bar { fn foo(&self) { ... } fn bar(&self) { foo(self); // foo in scope UFCS-style ... }
} Items from super traits are not in scope, however. See the discussion on super traits below for more detail. These scope rules provide good ergonomics for associated types in particular, and a consistent scope model for language constructs that can contain items (like traits, impls, and modules). In the long run, we should also explore imports for trait items, i.e. use Trait::some_method, but that is out of scope for this RFC. Note that, according to this proposal, associated types/lifetimes are not in scope for the optional where clause on the trait header. For example: trait Foo<Input> // type parameters in scope, but associated types are not: where Bar<Input, Self::Output>: Encodable { type Output; ...
} This setup seems more intuitive than allowing the trait header to refer directly to items defined within the trait body. It's also worth noting that trait-level where clauses are never needed for constraining associated types anyway, because associated types also have where clauses. Thus, the above example could (and should) instead be written as follows: trait Foo<Input> { type Output where Bar<Input, Output>: Encodable; ...
}

