When using trait objects, the Self type is "erased", so different types implementing the trait can be used under the same trait object type: impl Show for Foo { ... }
impl Show for Bar { ... } fn make_vec() -> Vec<Box<Show>> { let f = Foo { ... }; let b = Bar { ... }; let mut v = Vec::new(); v.push(box f as Box<Show>); v.push(box b as Box<Show>); v
} One consequence of erasing Self is that methods using the Self type as arguments or return values cannot be used on trait objects, since their types would differ for different choices of Self. In the model presented in this RFC, traits have additional input parameters beyond Self, as well as associated types that may vary depending on all of the input parameters. This raises the question: which of these types, if any, are erased in trait objects? The approach we take here is the simplest and most conservative: when using a trait as a type (i.e., as a trait object), all input and output types must be provided as part of the type. In other words, only the Self type is erased, and all other types are specified statically in the trait object type. Consider again the following example: trait Foo<Input1, Input2> { type Output1; type Output2; lifetime 'a; const C: bool; ...
} Unlike the case for static trait bounds, which do not have to specify any of the associated types, lifetimes, or consts, (but do have to specify the input types), trait object types must specify all of the types: fn consume_foo<T: Foo<I1, I2>>(t: T) // this is valid
fn consume_obj(t: Box<Foo<I1, I2>>) // this is NOT valid // but this IS valid:
fn consume_obj(t: Box<Foo<I1, I2, Output1 = O2, Output2 = O2, 'a = 'static, C = true>>) With this design, it is clear that none of the non-Self types are erased as part of trait objects. But it leaves wiggle room to relax this restriction later on: trait object types that are not allowed under this design can be given meaning in some later design.

