impl Iterable2 for Foo { ... } More formally, the coherence property is revised as follows: Given a trait and values for all its type parameters (inputs, including Self), there is at most one applicable impl. In the trait reform RFC , coherence is guaranteed by maintaining two other key properties, which are revised as follows: Orphan check : Every implementation must meet one of the following conditions: The trait being implemented (if any) must be defined in the current crate. At least one of the input type parameters (including but not necessarily Self) must meet the following grammar, where C is a struct or enum defined within the current crate: T = C | [T] | [T, ..n] | &T | &mut T | ~T | (..., T, ...) | X<..., T, ...> where X is not bivariant with respect to T Overlapping instances : No two implementations can be instantiable with the same set of types for the input type parameters. See the trait reform RFC for more discussion of these properties.

455.body:
The main limitation of associated items as presented here is about associated types in particular. You might be tempted to write a trait like the following: trait Iterable { type A; type I: Iterator<&'a A>; // what is the lifetime here? fn iter<'a>(&'a self) -> I; // and how to connect it to self?
} The problem is that, when implementing this trait, the return type I of iter must generally depend on the lifetime of self. For example, the corresponding method in Vec looks like the following: impl<T> Vec<T> { fn iter(&'a self) -> Items<'a, T> { ... }
} This means that, given a Vec<T>, there isn't a single type Items<T> for iteration -- rather, there is a family of types, one for each input lifetime. In other words, the associated type I in the Iterable needs to be "higher-kinded": not just a single type, but rather a family: trait Iterable { type A; type I<'a>: Iterator<&'a A>; fn iter<'a>(&self) -> I<'a>;
} In this case, I is parameterized by a lifetime, but in other cases (like map) an associated type needs to be parameterized by a type. In general, such higher-kinded types (HKTs) are a much-requested feature for Rust, and they would extend the reach of associated types. But the design and implementation of higher-kinded types is, by itself, a significant investment. The point of view of this RFC is that associated items bring the most important changes needed to stabilize our existing traits (and add a few key others), while HKTs will allow us to define important traits in the future but are not necessary for 1.0.

456.body:
That said, it's worth pointing out that variants of higher-kinded types can be encoded in the system being proposed here. For example, the Iterable example above can be written in the following somewhat contorted style: trait IterableOwned { type A; type I: Iterator<A>; fn iter_owned(self) -> I;
} trait Iterable { fn iter<'a>(&'a self) -> <&'a Self>::I where &'a Self: IterableOwned { IterableOwned::iter_owned(self) }
} The idea here is to define a trait that takes, as input type/lifetimes parameters, the parameters to any HKTs. In this case, the trait is implemented on the type &'a Self, which includes the lifetime parameter. We can in fact generalize this technique to encode arbitrary HKTs: // The kind * -> *
trait TypeToType<Input> { type Output;
}
type Apply<Name, Elt> where Name: TypeToType<Elt> = Name::Output; struct Vec_;
struct DList_; impl<T> TypeToType<T> for Vec_ { type Output = Vec<T>;
} impl<T> TypeToType<T> for DList_ { type Output = DList<T>;
} trait Mappable
{ type E; type HKT where Apply<HKT, E> = Self; fn map<F>(self, f: E -> F) -> Apply<HKT, F>;
} While the above demonstrates the versatility of associated types and where clauses, it is probably too much of a hack to be viable for use in libstd.

461.body:
In the future, we may wish to relax the "overlapping instances" rule so that one can provide "blanket" trait implementations and then "specialize" them for particular types. For example: trait Sliceable { type Slice; // note: not using &self here to avoid need for HKT fn as_slice(self) -> Slice;
} impl<'a, T> Sliceable for &'a T { type Slice = &'a T; fn as_slice(self) -> &'a T { self }
} impl<'a, T> Sliceable for &'a Vec<T> { type Slice = &'a [T]; fn as_slice(self) -> &'a [T] { self.as_slice() }
} But then there's a difficult question: fn dice<A>(a: &A) -> &A::Slice where &A: Slicable { a // is this allowed?
} Here, the blanket and specialized implementations provide incompatible associated types. When working with the trait generically, what can we assume about the associated type? If we assume it is the blanket one, the type may change during monomorphization (when specialization takes effect)! The RFC does allow generic code to "see" associated types provided by blanket implementations, so this is a potential problem. Our suggested strategy is the following. If at some later point we wish to add specialization, traits would have to opt in explicitly. For such traits, we would not allow generic code to "see" associated types for blanket implementations; instead, output types would only be visible when all input types were concretely known. This approach is backwards-compatible with the RFC, and is probably a good idea in any case.

463.body:
This RFC clarifies trait matching by making trait type parameters inputs to matching, and associated types outputs. A more radical alternative would be to remove type parameters from traits , and instead support multiple input types through a separate multidispatch mechanism. In this design, the Add trait would be written and implemented as follows: // Lhs and Rhs are *inputs*
trait Add for (Lhs, Rhs) { type Sum; // Sum is an *output* fn add(&Lhs, &Rhs) -> Sum;
} impl Add for (int, int) { type Sum = int; fn add(left: &int, right: &int) -> int { ... }
} impl Add for (int, Complex) { type Sum = Complex; fn add(left: &int, right: &Complex) -> Complex { ... }
} The for syntax in the trait definition is used for multidispatch traits, here saying that impls must be for pairs of types which are bound to Lhs and Rhs respectively. The add function can then be invoked in UFCS style by writing Add::add(some_int, some_complex) Advantages of the tuple approach : It does not force a distinction between Self and other input types, which in some cases (including binary operators like Add) can be artificial. Makes it possible to specify input types without specifying the trait: <(A, B)>::Sum rather than <A as Add<B>>::Sum. Disadvantages of the tuple approach : It's more painful when you do want a method rather than a function. Requires where clauses when used in bounds: where (A, B): Trait rather than A: Trait<B>. It gives two ways to write single dispatch: either without for, or using for with a single-element tuple. There's a somewhat jarring distinction between single/multiple dispatch traits, making the latter feel "bolted on". The tuple syntax is unusual in acting as a binder of its types, as opposed to the Trait<A, B> syntax. Relatedly, the generics syntax for traits is immediately understandable (a family of traits) based on other uses of generics in the language, while the tuple notation stands alone. Less clear story for trait objects (although the fact that Self is the only erased input type in this RFC may seem somewhat arbitrary). On balance, the generics-based approach seems like a better fit for the language design, especially in its interaction with methods and the object system.

