幂运算由 ** 运算符表示，有两个参数：基数和指数。 幂运算的结果取决于其操作数和运算结果（特别是如果结果可以表示为整数值）。 Groovy 的幂运算使用以下规则来确定结果类型： 如果指数是 小数 如果结果可以表示为整数，则返回整数 否则 如果结果可以表示为 Long，则返回 Long otherwise return a Double 如果指数是 整数 如果指数严格为负，则如果结果值适合该类型，则返回 Integer、Long 或 Double 如果指数为正数或零 如果基数是 BigDecimal，则返回 BigDecimal 结果值 如果基数是 BigInteger，则返回 BigInteger 结果值 如果基数是一个 Integer，则如果结果值 装得下它，则返回一个Integer，否则返回一个 BigInteger 如果基数是 Long，则如果结果值适合，则返回 Long，否则返回 BigInteger 我们可以用几个例子来说明这些规则： // base and exponent are ints and the result can be represented by an Integer
assert 2 ** 3 instanceof Integer // 8
assert 10 ** 9 instanceof Integer // 1_000_000_000 // the base is a long, so fit the result in a Long
// (although it could have fit in an Integer)
assert 5L ** 2 instanceof Long // 25 // the result can't be represented as an Integer or Long, so return a BigInteger
assert 100 ** 10 instanceof BigInteger // 10e20
assert 1234 ** 123 instanceof BigInteger // 170515806212727042875... // the base is a BigDecimal and the exponent a negative int
// but the result can be represented as an Integer
assert 0.5 ** -2 instanceof Integer // 4 // the base is an int, and the exponent a negative float
// but again, the result can be represented as an Integer
assert 1 ** -0.3f instanceof Integer // 1 // the base is an int, and the exponent a negative int
// but the result will be calculated as a Double
// (both base and exponent are actually converted to doubles)
assert 10 ** -1 instanceof Double // 0.1 // the base is a BigDecimal, and the exponent is an int, so return a BigDecimal
assert 1.2 ** 10 instanceof BigDecimal // 6.1917364224 // the base is a float or double, and the exponent is an int
// but the result can only be represented as a Double value
assert 3.4f ** 5 instanceof Double // 454.35430372146965
assert 5.6d ** 2 instanceof Double // 31.359999999999996 // the exponent is a decimal value
// and the result can only be represented as a Double value
assert 7.8 ** 1.9 instanceof Double // 49.542708423868476
assert 2 ** 0.1f instanceof Double // 1.0717734636432956

